ession : No obvious radiological abnormality seen.\r\n',NULL,NULL,NULL,1,0,2,'2012-02-04 12:18:41',0,'0000-00-00 00:00:00'),(9,'X-RAY RIGHT KNEE AP/Lat. VIEW',1,'X-Ray shows no evidence of intra-articular extension of fracture.\r\nKnee in fixed Position.\r\nPeriarticular osteopenia.\r\nArticular surfaces irregular.\r\n',NULL,NULL,NULL,1,0,2,'2012-02-04 12:19:33',0,'0000-00-00 00:00:00'),(10,'X-RAY RIGHT FEMUR AP/Lat. VIEW',1,'Fracture fragments alignment is good.\r\nExtra fixator (Schanz pins) also viewed.\r\nX-Ray shows evidence of Intramedullary Rod with Interlocking bolts.\r\nAlignment of fracture fragments is good.',NULL,NULL,NULL,1,0,2,'2012-02-04 12:23:01',0,'0000-00-00 00:00:00'),(11,'X-RAY RIGHT LEG AP/Lat. VIEW',1,'evidence of external fixator.\r\nevidence of displaced comminuted fracture shaft of tibia fibula.\r\nNo obvious fracture line visible .\r\nImplant in situ.\r\nNo obvious signs of Osteomyelitis.\r\nevidence of intramedullary interlock in tibia. \r\nAlignment of tibial fracture fragments satisfactory.',NULL,NULL,NULL,1,0,2,'2012-02-04 12:24:03',0,'0000-00-00 00:00:00'),(12,'X-RAY Forearm AP/Lat',1,'X-Ray shows evidence of Intra-medullary nail in Radius.\r\nAlignment of fracture fragments good.\r\n',NULL,NULL,NULL,1,0,2,'2012-02-04 12:26:50',9,'2012-07-30 07:21:32'),(13,'X-RAY Right tibia fibula AP/Lat. VIEW (Post OP)',1,'Fracture line appears filled.\r\nImplant in Situ.\r\nFibular continuity broken suggestive of Osteotomy.',NULL,NULL,NULL,1,0,2,'2012-02-04 12:27:50',0,'0000-00-00 00:00:00'),(14,'X-RAY Left forearm with wrist AP/Lat. VIEW',1,'Fracture both bones of forearm at level of Middle third  Lower third   junction of shaft.',NULL,NULL,NULL,1,0,2,'2012-02-04 12:46:27',0,'0000-00-00 00:00:00'),(15,'X-RAY Right tibia fibula AP/Lat. VIEW',1,'Fracture line seen at shaft of tibia.\r\nImplant in situ.\r\nFibula intact.',NULL,NULL,NULL,1,0,2,'2012-02-04 12:47:09',0,'0000-00-00 00:00:00'),(16,'X-RAY T-L SPINE AP/LAT. VIEW',1,'Kyphotic deformity with a