INSERT INTO `radiology_doctor_notes` VALUES (1,9,1,1,0,' \r\nX-Ray shows no evidence of intra-articular extension of fracture.\r\n\r\nKnee in fixed Position.\r\n\r\nPeriarticular osteopenia.\r\n\r\nArticular surfaces irregular.\r\n','2013-01-29 11:43:30',1,'2013-02-13 12:41:25',1),(2,9,40,1,0,' X-Ray1','2013-02-11 10:27:34',1,'0000-00-00 00:00:00',0),(3,48,40,1,0,' Changes are s/o hepatic parenchymal disease .\r\nSplenomegaly is seen.\r\nS/o portal hypertension.','2013-02-11 10:28:46',1,'0000-00-00 00:00:00',0),(4,4,42,1,0,' X-Ray shows e/o fracture shaft of 4th and 5th metacarpal ','2013-02-12 05:47:48',1,'0000-00-00 00:00:00',0),(5,65,52,1,0,' Sub Template31','2013-02-13 07:24:01',1,'0000-00-00 00:00:00',0),(6,10,1,1,0,' Fracture fragments alignment is good.\r\n\r\nExtra fixator (Schanz pins) also viewed.\r\n\r\nX-Ray shows evidence of Intramedullary Rod with Interlocking bolts.\r\n\r\nAlignment of fracture fragments is good.\r\n','2013-02-13 12:45:09',1,'0000-00-00 00:00:00',0),(7,38,52,1,0,' Rad Temp \r\n\r\n2D-Bmode and Colour flow study was performed.  Both iliac veins were examined. Deep venous system and superficial venous system of right lower limb was examined. Right common femoral, ProfundaFemoris, Superficial femoral vein, popliteal vein, anterior tibial vein and posterior tibial veins along with saphanous veins were examined. Calf veins also examined.   Normal colour flow pattern is noticed in all deep veins. \r\nNormal respiratory phasicityseen.\r\nNormal response to distal augmentation is preserved. \r\n\r\n\r\n\r\n\r\n\r\n','2013-02-14 06:45:12',1,'0000-00-00 00:00:00',0);
