INSERT INTO `radiology_template_texts` VALUES (1,1,'2-D B mode spectral and Colour Doppler Study was performed. Aorta, bilateral iliac, common, superficial and deep femoral, popliteal and tibial arteries were examined.',1,2,0,'2012-02-08 14:26:17',2,0,'0000-00-00 00:00:00'),(2,1,'Rest of the right lower limb arteries show normal course and caliber',1,2,1,'2012-02-08 14:33:16',2,0,'0000-00-00 00:00:00'),(3,1,'Subacute stenotic (approximately 60%) thrombosis of the right common femoral artery along its entire length with anterior eccentric patent lumen. Flow velocities are increased mildly in this segment. No significant flow dampening noted distal to the common femoral artery.',1,2,1,'2012-02-08 14:31:52',2,0,'0000-00-00 00:00:00'),(4,1,'Subacute stenotic (approximately 60%) thrombosis of the right common femoral artery along its entire length with anterior eccentric patent lumen. Flow velocities are increased mildly in this segment. No significant flow dampening noted distal to the common femoral artery.',1,2,0,'2012-02-08 14:35:33',2,0,'0000-00-00 00:00:00'),(5,1,'Similar occlusive thrombosis of the right mid and distal posterior tibial artery also noted.',1,2,0,'2012-02-08 14:35:50',2,0,'0000-00-00 00:00:00'),(6,1,'Rest of the right lower limb arteries show normal course and caliber.',1,2,0,'2012-02-08 14:36:09',2,0,'0000-00-00 00:00:00'),(7,1,'Left lower limb arteries show normal course and caliber with normal intimal echo. No plaques / calcifications noted.',1,2,0,'2012-02-08 14:36:25',2,0,'0000-00-00 00:00:00'),(8,1,'No thrombosis seen. Normal triphasic flow pattern is maintained in these arteries.',1,2,0,'2012-02-08 14:36:42',2,0,'0000-00-00 00:00:00'),(9,1,'Bilateral iliac arteries and aorta appear normal in course and caliber. With no obvious hemodynamically significant lesion.',1,2,0,'2012-02-08 14:37:07',2,0,'0000-00-00 00:00:00'),(10,2,'Subacute partial thrombosis of the right common femoral artery (approximately 60%) with no significant distal hemodynamic alterations.',1,2,0,'2012-02-08 14:37:56',2,0,'0000-00-00 00:00:00'),(11,2,'Similar occlusive thrombosis of the mid and distal right posterior tibial artery.',1,2,0,'2012-02-08 14:38:25',2,0,'0000-00-00 00:00:00'),(12,2,'No obvious hemodynamically significant lesion in the left lower limb arteries.',1,2,0,'2012-02-08 14:38:45',2,0,'0000-00-00 00:00:00'),(13,3,'Bilateral common, internal and external carotid and vertebral arteries were examined on 2D-B mode, spectral and colour Doppler.',1,2,0,'2012-02-08 14:42:53',2,0,'0000-00-00 00:00:00'),(14,3,'Bilateral atherosclerotic carotid artery disease.',1,2,0,'2012-02-08 14:43:09',2,0,'0000-00-00 00:00:00'),(15,3,'Minimally calcified and soft fibrofatty eccentric plaques noted in right and left carotid bulbs respectively. Approximately 40% luminal stenosis in left bulb. No appreciable stenosis on right.',1,2,0,'2012-02-08 14:43:25',2,0,'0000-00-00 00:00:00'),(16,3,'Minor plaques also noted in both proximal internal and external carotid arteries.',1,2,0,'2012-02-08 14:43:42',2,0,'0000-00-00 00:00:00'),(17,3,'No e/o plaque ulcerations or intraplaque hemorrhage.',1,2,0,'2012-02-08 14:43:59',2,0,'0000-00-00 00:00:00'),(18,3,'Rest of the carotid artery segments appear normal in course and caliber. Normal color and spectral flow patterns were recorded.',1,2,0,'2012-02-08 14:44:16',2,0,'0000-00-00 00:00:00'),(19,3,'Both vertebral arteries appear normal in course and caliber with normal ante grade flow.',1,2,0,'2012-02-08 14:44:31',2,0,'0000-00-00 00:00:00'),(20,4,'\r\nPortal Cavarnoma seen formed of multiple 2-3 mm smaller venous channels.   \r\n\r\nPortosystemic collaterals seen at following sites: \r\n\r\nGall bladder fossa (1-1.5 mm).\r\nGastrospelnic region (2 to 2.5 mm)\r\nLienorenal collaterals could not be ruled out.\r\n\r\nSplenic vein  3.2 mm. No e/o thrombosis.   \r\n\r\nMild splenomegaly.\r\n\r\nLiver is normal. Hepatic veins and IVC appear normal. \r\n\r\nNo ascites. ',1,2,0,'2012-02-09 07:34:16',2,0,'0000-00-00 00:00:00'),(21,5,'Extrahepatic portal hypertension due to chronic portal venous thrombosis with portosystemic collaterals at above described sites.',1,2,0,'2012-02-09 07:35:46',2,0,'0000-00-00 00:00:00'),(22,6,'2D-Bmode and Colour flow study was performed.  Right iliac vessels were examined. Right common femoral, ProfundaFemoris, Superficial femoral, popliteal, anterior tibial and posterior tibial vessels along with saphanous veins were examined. Calf veins also examined. \r\n\r\nSubacute to early chronic lumen occluding thrombosis of the right limb veins extending from common iliac upto popliteal bifurcation.\r\n\r\nNo e/o any significant recanalization.  \r\n\r\nNo e/o thrombosis of the superficial veins.\r\n\r\nSubacute to chronic occlusive thrombosis of the right limb veins extending from external iliac upto superficial femoral vein in the distal thigh.\r\n\r\nAlmost complete recanalization of the distal superficial and popliteal veins noted.    \r\n\r\nTibial veins appear normal with no e/o thrombosis.\r\n\r\nSubtle wall thickening and intraluminal septations noted s/o chronic recanalized thrombosis.\r\n\r\nNo e/o acute thrombosis.\r\n\r\nMild incompetence of the saphenofemoral junction noted. Saphenopopliteal junction is competent.  \r\n\r\nIncompetent perforators noted in the legs at midcalf and above ankle levels along the greater saphenous distribution.     \r\n\r\nIncompetence of the deep valves also noted.  \r\n',1,2,0,'2012-02-09 07:38:38',2,0,'0000-00-00 00:00:00'),(23,7,'Deep and superficial venous incompetence due to chronic recanalized deep venous thrombosis.',1,2,0,'2012-02-09 07:39:20',2,0,'0000-00-00 00:00:00'),(24,8,'2D-Bmode and Colour flow study was performed.  Both iliac veins were examined. Deep venous system and superficial venous system of right lower limb was examined. Right common femoral, ProfundaFemoris, Superficial femoral vein, popliteal vein, anterior tibial vein and posterior tibial veins along with saphanous veins were examined. Calf veins also examined. \r\n\r\nAcute to subacute occlusive thrombosis of right lower two third of superficial femoral, popliteal and its peroneal divisions.\r\n\r\nNo significant recanalization. \r\n\r\nRest of the limb veins appear normal in course and calibre with no e/o thrombosis at present. \r\n\r\nNo e/o venous incompetence.',1,2,0,'2012-02-09 07:41:09',2,0,'0000-00-00 00:00:00'),(25,9,'2D-Bmode and Colour flow study was performed. Deep venous system and superficial venous system of lower limb was examined. Common femoral, ProfundaFemoris, Superficial femoral vein, popliteal vein, anterior tibial vein and posterior tibial veins along with saphanous veins were examined. Calf veins also examined.',1,2,0,'2012-02-09 07:43:14',2,0,'0000-00-00 00:00:00'),(26,10,'Veins show normal course and calibre. \r\nLumina of the veins are devoid of any echogenic substance. \r\nAll the veins are completely compressible. \r\nNo wall thickening or internal septations seen. ',1,2,0,'2012-02-09 07:44:19',2,0,'0000-00-00 00:00:00'),(27,11,'Normal colour flow pattern is noticed in all deep veins.\r\n\r\nNormal respiratory phasicityseen.\r\n\r\nNormal response to distal augmentation is preserved. \r\n\r\nSaphenofemoral and saphenopopliteal junctions are competent. Incompetent perforator veins noted in the leg at midcalf and above ankle (approx 10 cm) in the greater saphenous distribution. Diameters of these veins measure 2.7 to 3.9 mms. Few dilated superficial varicosities noted at corresponding sites.\r\n\r\nDiffuse soft tissue edema also noted.',1,2,0,'2012-02-09 07:45:42',2,0,'0000-00-00 00:00:00'),(28,12,'Superficial venous incompetence in left leg at above described location. \r\nNo e/o deep venous incompetence. \r\nNo e/o acute or chronic superficial or deep venous thrombosis noted in the present study.',1,2,0,'2012-02-09 07:46:33',2,0,'0000-00-00 00:00:00'),(29,13,'2D-Bmode Colour and spectral Doppler was done.\r\n\r\nBoth common, internal & external carotid and vertebral arteries show normal course and caliber. Intima media is smooth and thin. No e/o plaques seen.   \r\n\r\nNormal color and spectral flow pattern was seen. \r\n\r\nFlow velocities are within normal limits. \r\n\r\nBoth vertebral arteries show normal ante grade flow. No flow reversal seen. ',1,2,0,'2012-02-09 07:50:24',2,0,'0000-00-00 00:00:00'),(30,14,'Normal carotid Doppler',1,2,0,'2012-02-09 07:51:09',2,0,'0000-00-00 00:00:00'),(31,15,'\r\n2D-Bmode, spectral and Color Doppler study was done.',1,2,0,'2012-02-09 07:52:33',2,0,'0000-00-00 00:00:00'),(32,16,'Acute thrombotic occlusion of the left internal carotid artery along its entire cervical course.\r\n\r\nFibro fatty and minimally calcified eccentric and circumferential plaques in bilateral distal common carotid, carotid bulbs and proximal external and internal carotid arteries causing approximately 20 % luminal stenosis.\r\n\r\nDiffuse thickening of the Intima  media complex in both common carotid arteries.',1,2,0,'2012-02-09 07:53:51',2,0,'0000-00-00 00:00:00'),(33,17,'Mildly higher flow resistance noted in bilateral common, external and right internal carotid arteries.  \r\n\r\nBoth vertebral arteries show adequate forward flow. ',1,2,0,'2012-02-09 07:54:42',2,0,'0000-00-00 00:00:00'),(34,18,'f/s/o atherosclerotic carotid artery disease with: \r\n\r\nAcute thrombotic occlusion of left internal carotid artery \r\n\r\nFibrofatty and calcified plaques in rest of both carotid arteries with no hemodynamically significant luminal stenosis. ',1,2,0,'2012-02-09 07:56:18',2,0,'0000-00-00 00:00:00'),(35,19,'2D-Bmode and Colour flow study was performed. Deep venous system and superficial venous system of lower limb was examined. Common femoral, ProfundaFemoris, Superficial femoral vein, popliteal vein, anterior tibial vein and posterior tibial veins along with saphanous veins were examined. Calf veins also examined.',1,2,0,'2012-02-09 07:58:52',2,0,'0000-00-00 00:00:00'),(36,20,'Veins show normal course and calibre. \r\n\r\nLumina of the veins are devoid of any echogenic substance. \r\n\r\nAll the veins are completely compressible. \r\n\r\nNo wall thickening or internal septations seen. ',1,2,0,'2012-02-09 07:59:54',2,0,'0000-00-00 00:00:00'),(37,21,'Normal colour flow pattern is noticed in all deep \r\n\r\nNormal respiratory phasicityseen.\r\n\r\nNormal response to distal augmentation is preserved. \r\n\r\nSaphenofemoral and saphenopopliteal junctions are competent. Incompetent perforator veins noted in the leg at midcalf and above ankle (approx 8 cm) in the greater saphenous distribution. Diameters of these veins measure 2.6 to 3.5 mms. Few dilated superficial varicosities noted at corresponding sites.\r\n\r\nDiffuse soft tissue edema also noted.',1,2,0,'2012-02-09 08:01:19',2,0,'0000-00-00 00:00:00'),(38,22,'Superficial venous incompetence in right leg at above described locations. \r\nNo e/o deep venous incompetence. \r\nNo e/o acute or chronic superficial or deep venous thrombosis noted in the present study. ',1,2,0,'2012-02-09 08:02:05',2,0,'0000-00-00 00:00:00'),(39,23,'Popliteal, tibial, calf and superficial veins are normal in course and calibre.    \r\n\r\nThey are completely compressible. \r\n\r\nTheir walls are smooth and thin. No internal septations seen. Normal colour flow pattern and respiratory phasicity seen.\r\n\r\nSaphenopopliteal junction is competent.',1,2,0,'2012-02-09 08:05:29',2,0,'0000-00-00 00:00:00'),(40,24,'No e/o venous thrombosis',1,2,0,'2012-02-09 08:06:52',2,0,'0000-00-00 00:00:00'),(41,25,'Popliteal, anterior & posterior tibial and dorsalispedis arteries appear normal in course and calibre. \r\n\r\nNo e/o luminal stenosis.\r\n \r\nNo thrombus seen. \r\n\r\nFlow pattern and velocities are within normal range with maintained normal triphasic waveforms',1,2,0,'2012-02-09 08:08:24',2,0,'0000-00-00 00:00:00'),(42,26,'Normal arterial Doppler.   \r\n\r\nDiffuse soft tissue edema s/o Cellulitis',1,2,0,'2012-02-09 08:09:39',2,0,'0000-00-00 00:00:00'),(43,27,'Atherosclerotic changes noted in the form of diffuse wall thickening and calcifications.\r\n\r\nIrregular variable degrees of short segment multifocal stenoses noted in the anterior and posterior tibial arteries with corresponding alterations in the colour and spectral flow patterns and velocity waveforms. \r\n\r\nSlightly dampened flow noted in the dorsalispedis and digital arteries. \r\n\r\nNo hemodynamically significant lesion noted in the femoral and popliteal arteries.  \r\n\r\nNo e/o deep venous thrombosis. ',1,2,0,'2012-02-09 08:11:38',2,0,'0000-00-00 00:00:00'),(44,28,'Atherosclerotic changes in left lower limb arteries with variable degrees of multifocal stenoses in the tibial arteries as described. \r\n\r\nNo e/o venous thrombosis.',1,2,0,'2012-02-09 08:12:30',2,0,'0000-00-00 00:00:00'),(45,29,'Few thin and thick bands seen in the distal superficial and popliteal vein. Popliteal veins also shows subtle wall thickening and is not completely compressible. \r\n\r\nRest of the veins including iliac veins show normal course and calibre. \r\n\r\nThey are completely compressible. Their walls are smooth and thin. No internal septations seen. Normal colour flow pattern and respiratory phasicity seen.\r\n\r\nSaphenofemoral and saphenopopliteal junctions are competent.',1,2,0,'2012-02-09 08:14:13',2,0,'0000-00-00 00:00:00'),(46,30,'Residual signs of chronic thrombosis in the distal superficial and popliteal veins. \r\nNo e/o venous incompetence.',1,2,0,'2012-02-09 08:15:32',2,0,'0000-00-00 00:00:00'),(47,31,'Mild wall thickening and calcifications of left lower limb arteries including common-superficial-deep femoral, popliteal, anterior & posterior tibial arteries.\r\n\r\nHowever no significant luminal narrowing noted. \r\n\r\nNo thrombus seen. \r\n\r\nFlow patterns and velocities are within normal ranges with maintained normal triphasic waveforms.',1,2,0,'2012-02-09 08:18:21',2,0,'0000-00-00 00:00:00'),(48,32,'Mild diffuse atherosclerotic changes. \r\n\r\nNo hemodynamically significant lesion seen.',1,2,0,'2012-02-09 08:19:44',2,0,'0000-00-00 00:00:00'),(49,34,'2D-Bmode, spectral and Color Doppler study was done.\r\n\r\nLumen occluding mildly echogenic thrombus is noted in the right common, superficial and deep femoral and popliteal arteries.\r\nNo wall calcifications noted in these arteries.   \r\n\r\nAnterior & posterior tibial and dorsalispedis arteries appear normal in course and caliber with thin smooth intimal surface. No e/o plaques/calcifications seen in the walls of these arteries. \r\nNo thrombus seen. Severely dampened flow was recorded in these arteries with peak velocities ranging from 6-8 cm/sec.     \r\nFew arterial collaterals detected in the thigh and around knee. \r\n\r\nAbdominal aorta and right iliac arteries show normal trphasic flow. \r\n',1,2,0,'2012-02-09 08:22:45',2,0,'0000-00-00 00:00:00'),(50,35,'Subacute lumen occluding thrombosis of the right common, superficial and deep femoral and popliteal origin of the posterior tibial arteries with severely dampened flow in the distal tibial and dorsalispedis arteries.',1,2,0,'2012-02-09 08:23:41',2,0,'0000-00-00 00:00:00'),(51,36,'Bilateral femoral, popliteal, tibial and superficial veins are normal in course and calibre.    \r\n\r\nThey are completely compressible. \r\n\r\nTheir walls are smooth and thin. No internal septations seen. Normal colour flow pattern and respiratory phasicity seen.\r\n\r\nSaphenofemoral and saphenopopliteal junctions are competent. ',1,2,0,'2012-02-09 08:26:01',2,0,'0000-00-00 00:00:00'),(52,37,'No e/o venous thrombosis.',1,2,0,'2012-02-09 08:26:59',2,0,'0000-00-00 00:00:00'),(53,38,'Common-superficial-deep femoral, popliteal, anterior & posterior tibial and dorsalispedis arteries appear normal in course and calibre with smooth walls. \r\n\r\nNo e/o luminal stenosis. \r\n\r\nNo thrombus seen. \r\n\r\nFlow pattern and velocities are within normal range with maintained normal triphasic waveforms',1,2,0,'2012-02-09 08:28:17',2,0,'0000-00-00 